import scrapeIt from "scrape-it";

const News = () => {
  useEffect(() => {
    scrapeIt("https://news.ycombinator.com/", {
      title: " .header h1",
      desc: ".header h2",
      avatar: {
        selector: ".header img",
        attr: "src",
      },
      // listItem: ".athing",
      // data: {
      //   title: ".storylink",
      //   href: { selector: ".storylink", attr: "href" },
      // },
    })
      .then(({ data, response }) => {
        console.log(`Status Code: ${response.statusCode}`);
        console.log(data);
      })
      .catch((err) => console.log("err", err))
      .finally(() => {
        console.log("final ");
      });
    console.log("useefffec");
  }, []);

  return <div></div>;
};

export default News;
